'use client';
import React, { useEffect, useState } from 'react';
import ReactDOMServer from 'react-dom/server';

import Button from '@/components/buttons/Button';
import UnderlineLink from '@/components/links/UnderlineLink';
import NextImage from '@/components/NextImage';

import { Carousel } from '@/app/components/carousel';
import cols from '@/app/components/ItemColumn';
import Loading from '@/app/components/loading';
import SingleTable from '@/app/components/tableSingle';
import Table from '@/app/components/tableSmall';

import { colsInfo } from '../components/patientColumns';

import {conductStudy} from './XRayStudyScript'

import { getAPatientsData, getActivePatientId } from '../../../../backend/database/backend';

export default function NewStudyPage() {
  const [loading, setLoading] = useState(true);
  const [loadingError, setLoadingError] = useState(false);
  const [image, setImage] = useState(false);
  const [image_name, setImageName] = useState(' ');
  const [pnRisk, setpnRisk] = useState('0%');
  const [atRisk, setatRisk] = useState('0%');
  const [caRisk, setcaRisk] = useState('0%');
  const [peRisk, setpeRisk] = useState('0%');
  const [processTime, setProccessTime] = useState(0);
  const [notes, setNotes] = useState('\n Image observations, other notes');

  const patientdata = () => {
    const info = [];
    info.push({
      PatientID: 1,
      MRN: 123,
      Name: 'Jack Mean',
      DOB: '2000-10-30',
      Gender: 'M',
      Contact: '111-111-1111',
      ReferringP: 'Dr. Spencer Smith',
      LastVisit: '2023-11-03',
    });
    return info;
  };

  const data = () => {
    const items = [];
    items.push({
      id: 0,
      name: 'Pneumonia',
      risk: pnRisk,
    });
    items.push({
      id: 1,
      name: 'Atelectasis',
      risk: atRisk,
    });
    items.push({
      id: 2,
      name: 'Cardiomegaly',
      risk: caRisk,
    });
    items.push({
      id: 3,
      name: 'Pleural effusion',
      risk: peRisk,
    });
    return items;
  };

  const images = [];
  images.push({
    src: '/images/emermed-2016-April-33-4-259-F1 1 (1).png',
    alt: 'image 2',
  });
  images.push({
    src: '/images/case1_008.jpg',
    alt: 'image 2',
  });

  function getPatientData() {
    const patientData: any[] = [];
    const patientDataTable = document.getElementById('patientDataTable');
    // get patient data from the backend using patientId (new state variable?)
    getActivePatientId()
      .then((activePatientId) => {
        if (activePatientId) {
          getAPatientsData(activePatientId)
            .then((pd) => {
              patientData.push({
                PatientID: pd.patientID,
                MRN: pd.mrn,
                Name: pd.firstName + " " + pd.lastName,
                DOB: pd.dob,
                Gender: pd.gender,
                Contact: pd.contact,
                ReferringP: pd.refPhys,
                LastVisit: pd.lastVisit
              });
              patientDataTable!.innerHTML = ReactDOMServer.renderToString(<Table data={patientData} columns={colsInfo}></Table>);
            })
            .catch((error) => {
              console.log(error);
            });
        }
      });
  }   

  useEffect(() => {
    //final timeout to reveal error message
    // setTimeout(() => setLoadingError(true), 10000)
    setTimeout(() => setLoading(false), 1000);
  }, []);

  const performStudy = async () => {



    const resultImagesCarousel = document.getElementById('resultImages');
    const originalImagesCarousel = document.getElementById('originalImages');
    const predictions = document.getElementById('predictions');

    let start = Date.now();

    // write and retrieve this value from the database
    // (e.g. temp variable activePatient in the backend database)
    let id = 3;

    let test = await conductStudy(8);
    console.log("post result" + test)
    // sample ml model results data
    let StudyResults = {
      "heatmaps": [
          "",
          ""
      ],
      "predictions": {
          "Atelectasis": 0.4432849735021591,
          "Cardiomegaly": 0.3742854967713356,
          "Pleural_Thickening": 0.32515817135572433,
          "Pneumonia": 0.5054616332054138
      },
      "report": "Highest priority: further investigation of Pneumonia recommended.\n\nModerate risk of Atelectasis, Pneumonia was found\nLow risk of Cardiomegaly, Pleural_Thickening was found\n",
      "xrayimgs": [
          "",
          ""
      ]
  };

    setTimeout(function() {
      setProccessTime((Date.now() - start) / 1000);
    }, 1234);

    const resultImages = [];
    for (let i = 0; i < StudyResults["heatmaps"].length; i++) {
      resultImages.push({
        src: "data:image/png;base64," + StudyResults["heatmaps"][i],
        alt: 'Result Image ' + i
      });
    }

    const originalImages = [];
    for (let i = 0; i < StudyResults["xrayimgs"].length; i++) {
      originalImages.push({
        src: "data:image/png;base64," + StudyResults["xrayimgs"][i],
        alt: 'Original Image ' + i
      });
    }

    setpnRisk((StudyResults["predictions"]["Pneumonia"]*100).toFixed(2).toString() + "%");
    setatRisk((StudyResults["predictions"]["Atelectasis"]*100).toFixed(2).toString() + "%");
    setcaRisk((StudyResults["predictions"]["Cardiomegaly"]*100).toFixed(2).toString() + "%");
    setpeRisk((StudyResults["predictions"]["Pleural_Thickening"]*100).toFixed(2).toString() + "%");

    const predData = () => {
      const items = [];
      items.push({
        id: 0,
        name: 'Pneumonia',
        risk: (StudyResults["predictions"]["Pneumonia"]*100).toFixed(2).toString() + "%"
      });
      items.push({
        id: 1,
        name: 'Atelectasis',
        risk: (StudyResults["predictions"]["Atelectasis"]*100).toFixed(2).toString() + "%"
      });
      items.push({
        id: 2,
        name: 'Cardiomegaly',
        risk: (StudyResults["predictions"]["Cardiomegaly"]*100).toFixed(2).toString() + "%"
      });
      items.push({
        id: 3,
        name: 'Pleural effusion',
        risk: (StudyResults["predictions"]["Pleural_Thickening"]*100).toFixed(2).toString() + "%"
      });
      return items;
    };

    resultImagesCarousel!.innerHTML = ReactDOMServer.renderToString(<Carousel data={resultImages} />);
    originalImagesCarousel!.innerHTML = ReactDOMServer.renderToString(<Carousel data={originalImages} />);
    predictions!.innerHTML = ReactDOMServer.renderToString(<SingleTable data={predData()} columns={cols} />);
    setNotes(StudyResults["report"]);
  }

  return (
    <>
      {loading && (
        <div>
          {loadingError && (
            <div
              className='text-gray-500'
              style={{
                position: 'fixed',
                top: 0,
                left: 0,
                width: '100%',
                height: '50%',
                display: 'flex',
                justifyContent: 'center',
                alignItems: 'center',
                zIndex: 99999,
              }}
            >
              <p>Error loading results</p>
            </div>
          )}
          <Loading />
        </div>
      )}
      <main
        className='bg-indigo-100'
        style={{
          backgroundImage:
            'linear-gradient(to bottom right, rgb(224, 231, 255), rgb(165, 180, 252))',
          height: '200vh',
        }}
      >
        <header className='mb-2'>
          <UnderlineLink href='/Main' className='px-8 text-indigo-500'>
            Main
          </UnderlineLink>
          <h1 className='text-m justify-center text-center text-indigo-500'>
            New Study
          </h1>
        </header>
        <section>
          <div className='layout relative flex flex-col justify-center gap-5 py-2'>
            <div className='flex items-center text-center' id="patientDataTable">
              <Table data={patientdata()} columns={colsInfo}></Table>
            </div>
            <div>
              <Button onClick={getPatientData} variant='primary' size='base'>
              Verify Patient
            </Button>
            </div>
            <div className='flex'>
              <div
                style={{
                  width: '70%',
                  height: '70vh',
                  flexDirection: 'column',
                  alignItems: 'center',
                }}
                className='text-center'
              >
                <h4 className='text-indigo-500' style={{ paddingRight: '10%' }}>
                  Result Images
                </h4>
                <div id="resultImages">
                  <Carousel data={images} />
                </div>
                <br></br>
                <h4 className='text-indigo-500' style={{ paddingRight: '10%' }}>
                  Original Images
                </h4>
                <div id="originalImages">
                  <Carousel data={images} />
                </div>
              </div>
              <div
                className='flex flex-col'
                style={{ height: '100vh', width: '50%' }}
              >
                <div style={{ height: '20%' }}></div>
                <div
                  className='bg-white py-2'
                  style={{ zIndex: 5, height: '100%' }}
                >
                  <Button onClick={performStudy} variant='primary' size='base'>
                    Perform Study
                  </Button>
                  <h3 className='text-m text-center text-indigo-500'>
                    Pathology Risk
                  </h3>
                  <div id="predictions">
                    <SingleTable data={data()} columns={cols} />
                  </div>
                  <div className='ps-2'>
                    <p>
                      <b>Processing Time: {processTime} seconds </b>
                    </p>
                    <p className='text-indigo-500'>
                      {' '}
                      <b>Report Notes: </b>{' '}
                    </p>
                    <p>{notes}</p>
                  </div>
                </div>
                <div
                  style={{
                    paddingLeft: '1%',
                    paddingTop: '10%',
                    position: 'absolute',
                    zIndex: 3,
                    width: '43%',
                    height: '89%',
                  }}
                >
                  <div
                    className='bg-indigo-500'
                    style={{ width: '100%', height: '100%' }}
                  ></div>
                </div>
              </div>
            </div>
          </div>
        </section>
      </main>
    </>
  );
}
